import React from "react";
import { Github, Linkedin, Twitter, Hexagon, Heart, Zap } from "lucide-react";
import { Link } from "react-router-dom";

const Footer: React.FC = () => {
  const year = new Date().getFullYear();

  return (
    <footer className="w-full bg-slate-50 border-t border-slate-200 mt-auto pt-12 pb-8">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">

        {/* Top Section: Grid */}
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-6 gap-10 mb-12">

          {/* Brand Column */}
          <div className="lg:col-span-2">
            <div className="flex items-center gap-2 mb-4">
              <div className="p-1.5 bg-blue-600 rounded-lg">
                <Hexagon size={20} className="text-white fill-blue-600" />
              </div>
              <span className="text-xl font-bold text-slate-800 tracking-tight">Collabryta</span>
            </div>
            <p className="text-slate-500 text-sm leading-relaxed mb-6 max-w-xs">
              Empowering teams to achieve more together. The next generation workspace for modern collaboration, task management, and seamless communication.
            </p>
            <div className="flex gap-4">
              <SocialLink href="#" icon={<Twitter size={18} />} label="Twitter" />
              <SocialLink href="#" icon={<Github size={18} />} label="GitHub" />
              <SocialLink href="#" icon={<Linkedin size={18} />} label="LinkedIn" />
            </div>
          </div>

          {/* Links Columns */}
          <div className="lg:col-span-4 grid grid-cols-2 sm:grid-cols-4 gap-8">
            <FooterColumn
              title="Product"
              links={[
                { label: "Features", to: "/features" },
                { label: "Pricing", to: "/pricing" },
                { label: "Integrations", to: "/integrations" },
                { label: "Changelog", to: "/updates" },
              ]}
            />
            <FooterColumn
              title="Company"
              links={[
                { label: "About Us", to: "/about" },
                { label: "Careers", to: "/careers" },
                { label: "Blog", to: "/blog" },
                { label: "Contact", to: "/contact" },
              ]}
            />
            <FooterColumn
              title="Resources"
              links={[
                { label: "Community", to: "/community" },
                { label: "Help Center", to: "/help" },
                { label: "API Docs", to: "/docs" },
                { label: "Status", to: "/status" },
              ]}
            />
            <FooterColumn
              title="Legal"
              links={[
                { label: "Privacy Policy", to: "/privacy" },
                { label: "Terms of Service", to: "/terms" },
                { label: "Security", to: "/security" },
              ]}
            />
          </div>
        </div>

        {/* Bottom Section: Copyright & Status */}
        <div className="pt-8 border-t border-slate-200 flex flex-col md:flex-row justify-between items-center gap-4">
          <div className="text-slate-500 text-sm flex items-center gap-1">
            &copy; {year} Collabryta Inc. Made with <Heart size={12} className="text-red-500 fill-red-500 inline mx-0.5" /> by the team.
          </div>

          <div className="flex items-center gap-6">
            <div className="flex items-center gap-2 px-3 py-1.5 bg-white border border-slate-200 rounded-full shadow-sm">
              <div className="relative flex h-2 w-2">
                <span className="animate-ping absolute inline-flex h-full w-full rounded-full bg-green-400 opacity-75"></span>
                <span className="relative inline-flex rounded-full h-2 w-2 bg-green-500"></span>
              </div>
              <span className="text-xs font-medium text-slate-600">All Systems Operational</span>
            </div>
          </div>
        </div>
      </div>
    </footer>
  );
};

// Sub-components for cleaner code
const FooterColumn: React.FC<{ title: string; links: { label: string; to: string }[] }> = ({ title, links }) => (
  <div>
    <h3 className="font-semibold text-slate-800 text-sm mb-4">{title}</h3>
    <ul className="space-y-3">
      {links.map((link) => (
        <li key={link.label}>
          <Link
            to={link.to}
            className="text-slate-500 text-sm hover:text-blue-600 hover:translate-x-0.5 transition-all inline-block"
          >
            {link.label}
          </Link>
        </li>
      ))}
    </ul>
  </div>
);

const SocialLink: React.FC<{ href: string; icon: React.ReactNode; label: string }> = ({ href, icon, label }) => (
  <a
    href={href}
    className="w-8 h-8 flex items-center justify-center rounded-full bg-white border border-slate-200 text-slate-500 hover:bg-slate-800 hover:text-white hover:border-slate-800 transition-all shadow-sm"
    aria-label={label}
  >
    {icon}
  </a>
);

export default Footer;
